localStorage.setItem('correctAnswers', '{}')
var origin_send = XMLHttpRequest.prototype.send;
XMLHttpRequest.prototype.send = function(data){
    const origin_onload = this.onload;
        this.onload = function(){
            if(this.responseText){
                const data = JSON.parse(this.responseText);
                if(data && data.data && data.data.chapterQuestionList){
                    const localCorrectAnswers = JSON.parse(localStorage.getItem('correctAnswers')),
                          chapterQuestionList = data.data.chapterQuestionList,
                          result = [];
                    chapterQuestionList.forEach(item=>{
                        item.checkedSelect = []
                        item.radioSelect = ''
                        let found = false;
                        result.forEach(subArr => {
                            if (subArr[0].time === item.time) {
                                subArr.push(item);
                                found = true;
                            }
                        });
                        if (!found) {
                            result.push([item]);
                        }
                    })
                    result.forEach(arrs=>{
                        arrs.forEach(arr=>{
                            localCorrectAnswers[arr.title] = arr.correctList
                        })
                    })
                    localStorage.setItem('correctAnswers', JSON.stringify(localCorrectAnswers))
                }
            }
            if(origin_onload)origin_onload.apply(this, arguments);
        }
    origin_send.call(this, data)
}
setInterval(function(){
    const flag = document.querySelector('.content-question');
    if(flag && flag.clientHeight > 0){
        const questionList = flag.querySelectorAll('.question-list'),
              correctAnswers = JSON.parse(localStorage.getItem('correctAnswers'));
        let needWait = 0;
        questionList.forEach(question=>{
            const title = question.querySelector('div[class="question-title"]').textContent.match(/[\u4e00-\u9fa5]+/g).join('');
            const qa_key = Object.keys(correctAnswers).find(key=>title.includes(key.match(/[\u4e00-\u9fa5]+/g).join('')));
            correctAnswers[qa_key].forEach((character, index)=>{
                // é˜²æ­¢ç‚¹å‡»å¤±æ•ˆå’Œé‡å¤ç‚¹å‡»
                if(!question.querySelector(`input[value="${character}"]`).checked){
                    setTimeout(()=>question.querySelector(`input[value="${character}"]`).click(), index*500);
                    needWait += 1
                }
            })
        });
        if(needWait)setTimeout(()=>document.evaluate("//div[text()='æäº¤']", document).iterateNext().click(), (needWait + 1) * 500)
    };
    //å¢žåŠ è°ƒæ•´é€ŸçŽ‡çš„æ’­æ”¾æŒ‰é’®
    const view = document.querySelector('.avue-view');
    if(view && !document.querySelector('#myChangeRateDiv')){
        const changeRateDiv = document.createElement('div'),
              video = document.getElementsByTagName('video')[0];
        changeRateDiv.className = 'back-btn';
        changeRateDiv.id = 'myChangeRateDiv';
        changeRateDiv.innerText = `è°ƒæ•´æ’­æ”¾é€ŸçŽ‡: ${video.playbackRate}x `;
        changeRateDiv.setAttribute(Array.from(view.attributes).find(attr=>attr.name.includes('data-v')).name, '')
        view.append(changeRateDiv)
        changeRateDiv.onclick = function(){
            if(video.playbackRate > 9)video.playbackRate = 1;
            else video.playbackRate += 1;
            changeRateDiv.innerText = `è°ƒæ•´æ’­æ”¾é€ŸçŽ‡: ${video.playbackRate}x `;
        }
    }
},4000)
